import React, { useState, useRef } from 'react';

const NewHome = () => {
	const getSpan = useRef();

	function testThis() {
		console.log(getSpan);
	}

	return (
		<div className="headerMain">
			<div className="headerContentContainer">
				<h1> Hey, I'm Matt!</h1>
				<h3 className="lightText70 max-width700">
					I'm a{' '}
					<span ref={getSpan} className="off pointer transitionAll">
						{' '}
						senior product designer{' '}
					</span>, an energetic lad, a <span className="off pointer transitionAll">coding enthusiast</span>, a
					<span className="off pointer transitionAll"> dog lover </span> & a
					<span className="off pointer transitionAll"> waterfall fantastic </span> !
				</h3>

				<div>
					<p onClick={testThis()} className="badge">
						Available for full-time opportunities{' '}
					</p>
				</div>
			</div>
		</div>
	);
};

export default NewHome;
